const Header = () => {
  return (
    <div className="header-container">
      <div className="nav-container">
        <div className="wrapper logo">lOGO</div>
        <div className="wrapper navlinks-center">
          <ul>
            <li>Products</li>
            <li>Products</li>
            <li>Products</li>
          </ul>
        </div>
        <div className="wrapper navlinks-right" />
      </div>
      <style jsx>
        {`
        .nav-container{
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            margin: auto;
        }
        .wrapper {
            background-color:pink;
        }
        .wrapper li{
            background-color:pink;
            text-decoration: none;
        }
        .header-container {
            width:100vw;
            height:100px;
            background-color: white;
            padding: 75px 75px;
        `}
      </style>
    </div>
  );
};

export default Header;
